import React from 'react';
import './App.css';
import Logo from './mschf-x-logo.gif' ;
import Video from './3D-shirt-video.mp4';
import Image1 from './assets/HMU_8679-Edit.jpg'
import Image2 from './assets/m1.jpg'
import Image3 from './assets/e-cs.jpg'
import Image4 from './assets/HMU_8117.jpg'

// import { ScrollMenu, VisibilityContext } from 'react-horizontal-scrolling-menu';
// import 'react-horizontal-scrolling-menu/dist/styles.css';

function App() {
  return (
    <div className='App'>
      <Header />
      <div className='Content'>
        <img width="138px" height="150px" src={Logo} />
        <div className='VideoContainer Bordered Shadowed'>
          <video className='Video' autoStart autoPlay muted loop src={Video} type="video/mp4" />
