        <img className="Image3 Bordered Shadowed" src={Image3} />
        <div className='Order Bordered Shadowed'>order pls</div>
        <img className="Image4 Bordered Shadowed" src={Image4} />
      </div>
      <Footer/>

    </div>
  );
}

function Header() {
  return (
    <header className='Ticker'>
